const Header = () => {
    return (
        <header className="bg-blue-900 text-white flex justify-between p-4">
            <div>
                <h1 className="text-2xl font-bold">Mi Página</h1>
            </div>
            <div className="flex space-x-4">
                <button className="bg-white text-blue-900 px-4 py-2 rounded">Iniciar Sesión</button>
                <button className="bg-white text-blue-900 px-4 py-2 rounded">Registrarse</button>
            </div>
        </header>
    );
};

export default Header;
